 // Helper function to format datetime for ServiceNow (FIXED)
 formatDateTimeForServiceNow(date = new Date()) {
 // ServiceNow expects datetime in 'yyyy-mm-dd HH:mm:ss' format
 const year = date.getFullYear();
 const month = String(date.getMonth() + 1).padStart(2, '0');
 const day = String(date.getDate()).padStart(2, '0');
 const hours = String(date.getHours()).padStart(2, '0');
 const minutes = String(date.getMinutes()).padStart(2, '0');
 const seconds = String(date.getSeconds()).padStart(2, '0');

 return `${year}-${month}-${day} ${hours}:${minutes}:${seconds}`;
 }

 // Helper function to calculate business days (excluding weekends)
 calculateBusinessDays(startDate, endDate) {
 const start = new Date(startDate);
 const end = new Date(endDate);
 let businessDays = 0;

 const currentDate = new Date(start);
 while (currentDate <= end) {
 const dayOfWeek = currentDate.getDay();
 // Monday = 1, Tuesday = 2, ..., Friday = 5 (exclude Saturday = 6, Sunday = 0)
 if (dayOfWeek !== 0 && dayOfWeek !== 6) {
 businessDays++;
 }
 currentDate.setDate(currentDate.getDate() + 1);
 }

 return businessDays;
 }

