 // Create sample daily summaries for demo - IMPROVED DATE HANDLING
 async createSampleDailySummaries() {
 try {
 const user = await this.getCurrentUser();
 if (!user) return [];

 const userId = typeof user.sys_id === 'object' ? user.sys_id.value : user.sys_id;
 const summaries = [];

 // Create last 30 days of sample data
 for (let i = 0; i < 30; i++) {
 const date = new Date();
 date.setDate(date.getDate() - i);
 const dateStr = date.toISOString().split('T')[0]; // 'yyyy-mm-dd' format

 // Skip weekends for more realistic data
 if (date.getDay() === 0 || date.getDay() === 6) continue;

 const hours = Math.floor(Math.random() * 3) + 7; // 7-10 hours
 const status = hours >= 8 ? 'online' : 'logout';

 // Create realistic datetime values
 const loginHour = 8 + Math.floor(Math.random() * 2); // 8-9 AM
 const loginMinute = Math.floor(Math.random() * 60);
 const logoutHour = loginHour + hours;
 const logoutMinute = Math.floor(Math.random() * 60);

 const firstLoginTime = this.formatDateTimeForServiceNow(
 new Date(`${dateStr}T${String(loginHour).padStart(2, '0')}:${String(loginMinute).padStart(2, '0')}:00`)
 );
 const lastLogoutTime = this.formatDateTimeForServiceNow(
 new Date(`${dateStr}T${String(logoutHour).padStart(2, '0')}:${String(logoutMinute).padStart(2, '0')}:00`)
 );

 const summaryData = {
 user: userId,
 date: dateStr,
 first_login: firstLoginTime,
 last_logout: lastLogoutTime,
 login_status: status,
 no_of_breaks: Math.floor(Math.random() * 3) + 1,
 total_hours: hours + (Math.random() * 0.5), // Add some decimal variation
 working_hours: hours - 0.5,
 break_hours: 0.5,
 work_location: Math.random() > 0.5 ? 'office' : 'home',
 is_present: true
 };

 try {
 const response = await fetch(`${this.baseUrl}/x_1599224_smart_of_daily_summary`, {
 method: 'POST',
 headers: this.headers,
 body: JSON.stringify(summaryData)
 });

 if (response.ok) {
 summaries.push(await response.json());
 } else {
 console.warn(`Failed to create summary for ${dateStr}:`, response.status);
 }
 } catch (error) {
 console.warn(`Error creating summary for ${dateStr}:`, error);
 }
 }

 console.log(`Created ${summaries.length} sample daily summaries`);
 return summaries;
 } catch (error) {
 console.error('Error creating sample daily summaries:', error);
 throw error;
 }
 }

