 // Get leave statistics - FIXED TO USE BUSINESS DAYS
 async getLeaveStats() {
 try {
 const leaves = await this.getLeaves();
 const currentYear = new Date().getFullYear();

 const yearLeaves = leaves.filter(leave => {
 const startDate = typeof leave.start_date === 'object' ? leave.start_date.display_value : leave.start_date;
 return startDate && startDate.startsWith(currentYear.toString());
 });

 const pending = yearLeaves.filter(leave => {
 const status = typeof leave.status === 'object' ? leave.status.value : leave.status;
 return status === 'pending';
 }).length;

 const totalDaysTaken = yearLeaves
 .filter(leave => {
 const status = typeof leave.status === 'object' ? leave.status.value : leave.status;
 return status === 'approved';
 })
 .reduce((total, leave) => {
 const days = typeof leave.days_requested === 'object' ? 
 parseInt(leave.days_requested.display_value || '0') : 
 parseInt(leave.days_requested || '0');
 return total + days;
 }, 0);

 // Get allocated leaves from user profile (default 20)
 const user = await this.getCurrentUser();
 let allocated = 20; // default
 if (user && user.x_1599224_smart_of_leaves_allocated) {
 allocated = typeof user.x_1599224_smart_of_leaves_allocated === 'object' ? 
 parseInt(user.x_1599224_smart_of_leaves_allocated.display_value || '20') : 
 parseInt(user.x_1599224_smart_of_leaves_allocated || '20');
 }

 return {
 pending,
 taken: totalDaysTaken,
 remaining: Math.max(0, allocated - totalDaysTaken), // Ensure non-negative
 allocated
 };
 } catch (error) {
 console.error('Error fetching leave stats:', error);
 return { pending: 0, taken: 0, remaining: 20, allocated: 20 };
 }
 }

