export default function LeaveTracker({ service, currentUser }) {
 const [leaves, setLeaves] = useState([]);
 const [pendingLeaves, setPendingLeaves] = useState([]); // For admin approval
 const [leaveStats, setLeaveStats] = useState({ pending: 0, taken: 0, remaining: 20, allocated: 20 });
 const [showForm, setShowForm] = useState(false);
 const [loading, setLoading] = useState(true);
 const [isAdmin, setIsAdmin] = useState(false);
 const [activeTab, setActiveTab] = useState('overview'); // overview, requests, approvals
 const [approvalAction, setApprovalAction] = useState(null);
 const [formData, setFormData] = useState({
 leave_type: '',
 start_date: '',
 end_date: '',
 reason: ''
 });

 useEffect(() => {
 if (service) {
 loadLeaveData();
 checkAdminRole();
 }
 }, [service]);

 const checkAdminRole = async () => {
 try {
 const roles = await service.getUserRoles();
 setIsAdmin(roles.includes('admin'));
 } catch (error) {
 console.error('Error checking admin role:', error);
 }
 };

 const loadLeaveData = async () => {
 try {
 const [leaveList, stats, pendingList] = await Promise.all([
 service.getLeaves(),
 service.getLeaveStats(),
 service.getAllPendingLeaves()
 ]);
 setLeaves(leaveList);
 setLeaveStats(stats);
 setPendingLeaves(pendingList);
 } catch (error) {
 console.error('Error loading leave data:', error);
 } finally {
 setLoading(false);
 }
 };

 const handleSubmit = async (e) => {
 e.preventDefault();

 // Validate dates
 const startDate = new Date(formData.start_date);
 const endDate = new Date(formData.end_date);

 if (endDate < startDate) {
 alert('End date must be after start date');
 return;
 }

 const businessDays = service.getBusinessDays(formData.start_date, formData.end_date);
 if (businessDays === 0) {
 alert('Your leave request only includes weekends. Please select at least one business day.');
 return;
 }

 try {
 await service.createLeaveRequest(formData);
 setFormData({ leave_type: '', start_date: '', end_date: '', reason: '' });
 setShowForm(false);
 await loadLeaveData(); // Refresh data
 alert(`Leave request submitted successfully for ${businessDays} business day(s)!`);
 } catch (error) {
 console.error('Error creating leave request:', error);
 alert('Error creating leave request. Please try again.');
 }
 };

 const handleInputChange = (e) => {
 setFormData({
 ...formData,
 [e.target.name]: e.target.value
 });
 };

 const handleApproval = async (leaveId, status, comments = '') => {
 try {
 await service.updateLeaveStatus(leaveId, status, comments);
 await loadLeaveData(); // Refresh data
 setApprovalAction(null);
 alert(`Leave ${status === 'approved' ? 'approved' : 'rejected'} successfully!`);
 } catch (error) {
 console.error('Error updating leave status:', error);
 alert('Error processing approval. Please try again.');
 }
 };

 const getBusinessDays = () => {
 if (formData.start_date && formData.end_date) {
 return service.getBusinessDays(formData.start_date, formData.end_date);
 }
 return 0;
 };

 const getCalendarDays = () => {
 if (formData.start_date && formData.end_date) {
 const startDate = new Date(formData.start_date);
 const endDate = new Date(formData.end_date);
 const timeDiff = endDate.getTime() - startDate.getTime();
 const daysDiff = Math.ceil(timeDiff / (1000 * 3600 * 24)) + 1;
 return daysDiff > 0 ? daysDiff : 0;
 }
 return 0;
 };

 const getWeekendDays = () => {
 return getCalendarDays() - getBusinessDays();
 };

 const getStatusBadgeClass = (status) => {
 const statusValue = typeof status === 'object' ? status.value : status;
 switch(statusValue) {
 case 'pending': return 'status-pending';
 case 'approved': return 'status-approved';
 case 'rejected': return 'status-rejected';
 default: return 'status-pending';
 }
 };

 const getPendingLeaves = () => leaves.filter(leave => {
 const status = typeof leave.status === 'object' ? leave.status.value : leave.status;
 return status === 'pending';
 });

 const ApprovalModal = ({ leave, onClose, onApprove }) => {
 const [comments, setComments] = useState('');
 const [action, setAction] = useState('approved');

 const userName = typeof leave.user === 'object' ? leave.user.display_value : leave.user;
 const leaveType = typeof leave.leave_type === 'object' ? leave.leave_type.display_value : leave.leave_type;
