 <div className="detail-row">
 <strong> Employee:</strong> {userName}
 </div>
 <div className="detail-row">
 <strong> Leave Type:</strong> {leaveType}
 </div>
 <div className="detail-row">
 <strong> Duration:</strong> {new Date(startDate).toLocaleDateString()} to {new Date(endDate).toLocaleDateString()}
 </div>
 <div className="detail-row">
 <strong> Business Days:</strong> <span style={{color: 'var(--secondary-color)', fontWeight: 'bold'}}>{daysRequested} days</span>
