export default function ProfileUploadModal({ service, currentUser, onClose, onUpdate }) {
 const [uploading, setUploading] = useState(false);
 const [selectedFile, setSelectedFile] = useState(null);

 const handleFileSelect = (event) => {
 const file = event.target.files[0];
 if (file) {
 // Validate file type and size
 if (!file.type.startsWith('image/')) {
 alert('Please select an image file');
 return;
 }
 if (file.size > 5 * 1024 * 1024) { // 5MB limit
 alert('File size must be less than 5MB');
 return;
 }
 setSelectedFile(file);
 }
 };

 const handleUpload = async () => {
 if (!selectedFile) return;

 setUploading(true);
 try {
 await service.updateProfilePicture(selectedFile);
 onUpdate();
 } catch (error) {
 console.error('Error uploading profile picture:', error);
 alert('Error uploading profile picture. Please try again.');
 } finally {
 setUploading(false);
 }
 };

 const handleRemove = async () => {
 setUploading(true);
 try {
 await service.removeProfilePicture();
 onUpdate();
 } catch (error) {
 console.error('Error removing profile picture:', error);
 alert('Error removing profile picture. Please try again.');
 } finally {
 setUploading(false);
 }
 };

 return (
 <div className="modal-overlay" onClick={onClose}>
 <div className="modal" onClick={(e) => e.stopPropagation()}>
 <h3>Update Profile Picture</h3>

 <div className="file-upload">
 <input 
 type="file" 
 accept="image/*" 
 onChange={handleFileSelect}
 id="profile-upload"
 />
 <label htmlFor="profile-upload">
 <div style={{ textAlign: 'center' }}>
 <div style={{ fontSize: '2rem', marginBottom: '0.5rem' }}></div>
 <p>{selectedFile ? selectedFile.name : 'Click to select an image'}</p>
 <p style={{ fontSize: '0.8rem', color: 'var(--text-light)', marginTop: '0.5rem' }}>
 Max 5MB JPG, PNG, GIF
 </p>
 </div>
 </label>
 </div>

 <div style={{ display: 'flex', gap: '0.5rem', justifyContent: 'center' }}>
 <button 
 className="btn btn-primary" 
 onClick={handleUpload}
 disabled={!selectedFile || uploading}
 >
 {uploading ? 'Uploading...' : 'Upload'}
 </button>

 {currentUser && currentUser.photo && (
 <button 
 className="btn btn-danger" 
 onClick={handleRemove}
 disabled={uploading}
 >
 {uploading ? 'Removing...' : 'Remove'}
 </button>
 )}

 <button className="btn btn-secondary" onClick={onClose}>
 Cancel
 </button>
 </div>
 </div>
 </div>
 );
}",".home-page {
